import React from 'react';
import ReactDOM from 'react-dom';
import "./css/data.css";
import "./css/generic.css";
import "./css/header.css";
import "./css/main.css";
import "./css/slider.css";
import "./css/topBar.css.css";

const Header = () => {
  return (
    <div>
        <div id="title_text_div"> <h3>cryptofeeder.com</h3> </div>
        <div id="login_signup_button_div">
            <button id="login_button" className="button_primary">Login</button>
            <button id="signup_button" className="button_primary">Sign Up</button>
        </div>
    </div>
    )
};

ReactDOM.render(<Header/>, document.getElementById("test"));
